import React from "react";
import {
  AppBar,
  Box,
  Container,
  CssBaseline,
  Grid,
  Toolbar,
  Typography,
} from "@mui/material";
import ArrowBackIcon from "@mui/icons-material/ArrowBack";
import CloseIcon from "@mui/icons-material/Close";

const ChatFeed = ({ setLayout, id }) => {
  return (
    <Box>
      <CssBaseline />
      <AppBar color="transparent">
        <Toolbar>
          <ArrowBackIcon />
          <Box display="grid" ml="17.6px">
            <Typography sx={{ color: "primary.main" }} variant="subtitle2">
              I-589 - AMARKHIL, Obaidullah [Affirmative Filing with ZHN]
            </Typography>

            <Typography sx={{ fontSize: "10.9px" }}>3 Participants</Typography>
          </Box>
          <CloseIcon />
        </Toolbar>
      </AppBar>
      <Container>
        <Box>Hello</Box>
      </Container>
    </Box>
  );
};

export default ChatFeed;
